import React, { Component, useRef } from "react";
import { TwitchPlayer, TwitchPlayerInstance } from "react-twitch-embed";
import './App.css';


const TwitchView = (props) => {

  return (
    <div>
			<iframe
		    src="https://player.twitch.tv/?channel=ampm_m&parent=streamernews.example.com&muted=true"
    		height="720"
		    width="1280"
   		  allowfullscreen>
			</iframe>

		  <TwitchPlayer
          channel="ampm_m"
          parent={["codesandbox.io"]}
          hideControls={false}
          muted={props.muted}
          width={750}
          height={750}

      />
    </div>
  );
}

export default TwitchView;
